import React from 'react';
import ReactDOM from 'react-dom'

import youtuber,{favprog, myName, myNames} from './App'

ReactDOM.render(
    <>
    {youtuber}
    {favprog}
    <h1> Top Names Of Fruits </h1>
    <ol>
    {myName()}
    {myNames()}
    <li>Apple</li>
    <li>Mango</li>
    <li>Orange</li>
    <li>Banana</li>
    <li>Kiwi</li>
    </ol>
    </>,document.getElementById("root")
)
